import React from "react";
import { todosLosPaises } from "../redux/accion";
import { useEffect } from "react";
import { useSelector, useDispatch } from "react-redux";
// import { useState } from "react";
import Card from "./Card";
export default function Paises() {
  const paise = useSelector((state) => state.todosLosPaises);
  useEffect(() => {
    dispatch(todosLosPaises());
  }, [paise]);
  const dispatch = useDispatch();
  console.log(paise, "#");
  return (
    <div>
      {console.log(paise, "hola")}
      {paise.map((e) => {
        return (
          <Card pais={e.pais} bandera={e.bandera} continente={e.continente} />
        );
      })}
    </div>
  );
}
